A Florida native perennial, the cow lilly lives in ponds, lakes, bayous, bogs and can grow in waters up to 16 feet deep. It is also the most common aquatic plant in Florida. The lily has large yellow showy flowers that bloom from early Spring and well into Fall. 
Native Americans used spatterdock to stop bleeding or as a pain reliever. Some Canadian tribes used spatterdock as an anaphrodisiac and as treatment for infertility. A tea made from the root has been used to treat dysentery and diarrhea. 💩
